import React from 'react'
import Monday from './weekdays/Monday.js'
import Tuesday from './weekdays/Tuesday.js'
import Wednesday from './weekdays/Wednesday.js'
import Thursday from './weekdays/Thursday.js'
import Friday from './weekdays/Friday.js'
import Saturday from './weekdays/Saturday.js'
import Sunday from './weekdays/Sunday.js'

class Weekbox extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            shipSelected: 'Vargur'
        }
    };
    // add some way to change the state of this mofo. Been looking at dropdown menus and other things too.
    render(){
        return (
        <table className = "HeatMap">
            <Monday shipSelected = {this.state.shipSelected}/>
            <Tuesday shipSelected = {this.state.shipSelected}/>
            <Wednesday shipSelected = {this.state.shipSelected}/>
            <Thursday shipSelected = {this.state.shipSelected}/>
            <Friday shipSelected = {this.state.shipSelected}/>
            <Saturday shipSelected = {this.state.shipSelected}/>
            <Sunday shipSelected = {this.state.shipSelected}/>
        </table>
        )
    }
}

export default Weekbox
